export const login = async (credentials) => {
  const res = await fetch('http://localhost:8000/auth/login/', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify(credentials),
  });
  return await res.json();
};
